import React, { useState } from 'react';
import { Form, Input, Button, Upload, message } from 'antd';
import { UploadOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';

const RegRow = () => {
    const [form] = Form.useForm();
    const [fileList, setFileList] = useState([]);

    const onFinish = async (values) => {
        const formData = new FormData();
        formData.append('Nombre', values.nombre); // Cambiar 'nombre' a 'Nombre'
        formData.append('Correo', values.correo); // Cambiar 'correo' a 'Correo'
        if (values.Imagen && values.Imagen.length > 0) { // Cambiar 'imagen' a 'Imagen'
            formData.append('Imagen', values.Imagen[0].originFileObj); // Cambiar 'imagen' a 'Imagen'
        }

        try {
            const response = await fetch('http://localhost:8000/Ajustadores/RegistrarAjustadores', {
                method: 'POST',
                body: formData
            });
            console.log("Datos"+formData);
            if (!response.ok) {
                throw new Error('Error en el servidor');
            }

            message.success('Usuario registrado correctamente');
            form.resetFields();
            setFileList([]);
        } catch (error) {
            console.error('Error:', error.message);
            message.error('Hubo un error al procesar la solicitud');
        }
    };

    const onFinishFailed = (errorInfo) => {
        console.error('Failed:', errorInfo);
    };

    const normFile = (e) => {
        if (Array.isArray(e)) {
            return e;
        }
        return e && e.fileList;
    };

    const uploadProps = {
        onRemove: (file) => {
            setFileList((prevList) => prevList.filter((item) => item.uid !== file.uid));
        },
        beforeUpload: (file) => {
            setFileList((prevList) => [...prevList, file]);
            return false;
        },
        fileList,
    };

    return (
        <Form
            form={form}
            name="basic"
            initialValues={{ remember: true }}
            onFinish={onFinish}
            onFinishFailed={onFinishFailed}
        >
            <Form.Item
                label="Nombres"
                name="nombres"
                rules={[{ required: true, message: 'Por favor ingresa tu nombre!' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item
                label="Apellidos"
                name="Apellidos"
                rules={[{ required: true, message: 'Por favor ingresa tu nombre!' }]}
            >
                <Input />
            </Form.Item>
            <Form.Item
                label="Correo"
                name="correo"
                rules={[{ required: true, message: 'Por favor ingresa tu correo!' }]}
            >
                <Input />
            </Form.Item>

            <Form.Item
                label="Imagen"
                name="Imagen" // Cambiar 'imagen' a 'Imagen'
                valuePropName="fileList"
                getValueFromEvent={normFile}
            >
                <Upload {...uploadProps}>
                    <Button icon={<UploadOutlined />}>Seleccionar Archivo</Button>
                </Upload>
            </Form.Item>

            <Form.Item>
                <Button type="primary" htmlType="submit">
                    Registrar
                </Button>
            </Form.Item>
            <Link to="/Login">
              <Button type="primary">Ir a Login</Button>
            </Link>
        </Form>
    );
};

export default RegRow;
